    "name": "PrivHost Enhanced Security Ruleset",
    "description": "Ruleset to enhance security by filtering high-threat traffic, bots, and certain data center IPs.",
    "rules" : [
        {
            "action": "block",
            "description": "Block IPs with high threat scores (over 50)",
            "enabled": true,
            "expression": "cf.threat_score gt 50"
        },
        {
            "action": "block",
            "description": "Block traffic from known bot sources",
            "enabled": true,
            "expression": "cf.client.bot"
        },
        {
            "action": "block",
            "description": "Block traffic from data center IPs (ASNs)",
            "enabled": true,
            "expression": "ip.geoip.asnum in {16509 14618 7224 15169 396982 8075 8068 12076 14061 393406 63949 20473 16276 35540 24940 45102 37963 10532 36351 27257 31898 20773 16265 12876 54113 20940 15133 54825}"
        }
    ]
}

